import React, {useState} from "react";
import {Button, Modal, Table} from "react-bootstrap";
import ButtonCreate from "../ButtonCreate";
import MyModal from "../MyModal";
import 'bootstrap/dist/css/bootstrap.min.css';
import './MySales.scss';
import {ReactSVG} from "react-svg";
import buttonIcon from "../../assets/images/button-icon.svg";
import plus from "../../assets/images/plus.svg";
import MainTitle from "../MainTitle";
import edit from "../../assets/images/edit.svg";
import del from "../../assets/images/Delete.svg";



const MySales = (props) => {
	const [modalShow, setModalShow] = React.useState(false);

	const mySalesProps = {
		title: "My sales",
		description: "Sales table"
	}

	const modalCreate = {
		title: 'Create a product',
		buttonIcon: {plus},
		buttonText: 'Add product',
		inputs: [
			{
				type: 'text',
				placeholder: 'Store'
			},
			{
				type: 'text',
				placeholder: 'Price'
			},
			{
				type: 'text',
				placeholder: 'Product name'
			},
			{
				type: 'text',
				placeholder: 'Product Category'
			},
			{
				type: 'text',
				placeholder: 'Quantity of goods'
			},
			{
				type: 'text',
				placeholder: 'Weight / Volume of one item'
			},
		]
	}

	return (
		<div className="wrap">
			<div className="wrap__top">
				<MainTitle title={mySalesProps.title} description={mySalesProps.description}/>
				<Button className="button" variant="primary" onClick={() => setModalShow(true)}>
					<ButtonCreate />
				</Button>
				<MyModal
					info={modalCreate}
					show={modalShow}
					onHide={() => setModalShow(false)}
				/>
			</div>
			<hr/>
			<div className="wrap__content">
				<Table striped borderless>
					<thead>
					<tr>
						<th>Product name</th>
						<th>Store</th>
						<th>Address</th>
						<th>Category</th>
						<th>Creation date</th>
						<th>Price</th>
						<th>Remains</th>
						<th>Weight / Volume</th>
						<th>Actions</th>
					</tr>
					</thead>
					<tbody>
					{products.map((product) => (
						<tr>
							<td>{product.productName}</td>
							<td>{product.store}</td>
							<td>{product.address}</td>
							<td>{product.category}</td>
							<td>{product.createDate}</td>
							<td>{product.price}</td>
							<td>{product.remains}</td>
							<td>{product.weight}</td>
							<td>
								<div className="table__actions">
									<button className="table__actions-sell" onClick={() => setModalShow(true)}>Sell</button>

									<button className="table__actions-edit" onClick={() => setModalEditShow(true)}>
										<ReactSVG className="" src={edit} />
									</button>
									<ReactSVG className="table__actions-del" src={del} />
								</div>
							</td>
						</tr>
					))}
					<MyModal
						info={modalSell}
						show={modalShow}
						onHide={() => setModalShow(false)}
					/>
					<MyModal
						info={modalEdit}
						show={modalEditShow}
						onHide={() => setModalEditShow(false)}
					/>
					</tbody>
				</Table>
			</div>
		</div>
	)
}

export default MySales;
